import React, { useState } from "react";
import "./style.css";

const input = () => {
  const [productName, setProductName] = useState("");
  const [description, setDescription] = useState("");
  const [availableQuantity, setAvailableQuantity] = useState("");
  const [productDate, setProductDate] = useState("");
  const [productImage, setProductImage] = useState("");
  const [typeOfCar, setTypeOfCar] = useState("");
  const [price, setPrice] = useState("");

  const handleSubmit = (event) => {
    event.preventDefault();
    // هنا يمكنك إرسال البيانات المدخلة إلى الخادم أو إجراء أي عملية أخرى
    console.log({
      productName,
      description,
      availableQuantity,
      productDate,
      productImage,
      typeOfCar,
      price
    });
    // إعادة تعيين حقول الإدخال بعد الإرسال
    setProductName("");
    setDescription("");
    setAvailableQuantity("");
    setProductDate("");
    setProductImage("");
    setTypeOfCar("");
    setPrice("");
  };

  return (
    <div className="add-product-page">
      <form onSubmit={handleSubmit}>
        <div className="div">
          <div className="overlap-group">
            <div className="product-name">Product Name:</div>
            <input
              type="text"
              className="input-box"
              value={productName}
              onChange={(e) => setProductName(e.target.value)}
              required
            />
            <div className="description">Description:</div>
            <input
              type="text"
              className="input-box2"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
              required
            />
            <div className="available-quantity">Available Quantity:</div>
            <input
              type="text"
              className="input-box3"
              value={availableQuantity}
              onChange={(e) => setAvailableQuantity(e.target.value)}
              required
            />
            <div className="product-date">Product Date:</div>
            <input
              type="date"
              className="input-box"
              value={productDate}
              onChange={(e) => setProductDate(e.target.value)}
              required
            />
            <div className="product-image">Product Image:</div>
            <input
              type="text"
              className="input-box"
              value={productImage}
              onChange={(e) => setProductImage(e.target.value)}
              required
            />
            <div className="type-of-car">Type Of Car:</div>
            <input
              type="text"
              className="input-box4"
              value={typeOfCar}
              onChange={(e) => setTypeOfCar(e.target.value)}
              required
            />
            <div className="price">Price:</div>
            <input
              type="number"
              className="input-box5"
              value={price}
              onChange={(e) => setPrice(e.target.value)}
              required
            />
            <button type="submit" className="button">
              Submit
            </button>
          </div>
        </div>
      </form>
    </div>
  );
};

export default input;
